import React from "react";
import carMarket from "../carMarket";
import "./App.css";
import Nav from "./nav/Nav.js";

function App() {
  const getAllButtonsLable = (data) => {
    let res = [];
    for (let key in carMarket) {
      res.push(key);
    }
    return res.map((title) => {
      console.log(title);
      let btntitle = title.charAt(0).toUpperCase() + title.slice(1);
      return btntitle.replace("_", " ");
    });
  };

  return (
    <div className="nav">
      <Nav title={getAllButtonsLable(carMarket)} />
    </div>
  );
}

export default App;
